  return (
    <div>
      {
        url === "http://localhost:3000/Home"
        ? <Home/>
        :url === "http://localhost:3000/destino"
        ? <Home/>
        :url === "http://localhost:3000/promoções"
        ? <Home/>
        :url === "http://localhost:3000/contatos"
        ? <Home/>
        : "Erro"
      }
    </div>


  );
}

export default App;
